Multiple Mongoose Calls Within a For Each Loop<p>I am reading a JSON object and looping through each item. I am first checking to see if the item already exists in the database and if so I want to log a message. If it doesn't already exist I want to add it.</p>

<p><strong>This is working correctly</strong> however, I would like to add a callback or finish the process with process.exit();</p>

<p>Because the mongoose calls are asynchronous I can't put it at the end of the for loop because they haven't finished.</p>

<p>Whats the best way I should handle this?</p>

<pre><code>function storeBeer(data) {
    data.forEach((beer) =&gt; {
        let beerModel = new Beer({
            beer_id: beer.id,
            name: beer.name,
            image_url: beer.image_url
        });
        Beer.findOne({
            'name': beer.name
        }).then(function (result) {
            if (result) {
                console.log(`Duplicate ${result.name}`)
            } else {
                beerModel.save(function (err, result) {
                    console.log(`Saved: ${result.name}`)
                });
            }
        });
    });
}
</code></pre>

<p>Is there anything I should read up on to help solve this?</p>

