Why am I getting a validation error even though I'm providing data?<p>For some reason, the backend of my app doesn't think I'm providing data, even though I am, while testing my routes.</p>

<p>I've looked around, but I haven't found anything that quite matches up to the problem I'm having.</p>

<p>I've been trying to build the backend for my app by following this tutorial series: <a href="https://www.youtube.com/playlist?list=PL55RiY5tL51q4D-B63KBnygU6opNPFk_q" rel="nofollow noreferrer">https://www.youtube.com/playlist?list=PL55RiY5tL51q4D-B63KBnygU6opNPFk_q</a></p>

<p>Before I added validation to my models, I received 200s and 201s for my HTTP requests. Once I added validation, I began receiving error messages informing me that I'm not providing the necessary information, even though I am.</p>

<p>I'm using Mongoose 5.5.8, Cors 2.8.5, Body-Parser 1.19.0, and Postman 7.1.1.</p>

<p>I've tried using the .exec() method once, but that only gave me a worse error.</p>

<p>Here is my model:</p>

<pre><code>const studentSchema = mongoose.Schema({
  _id: mongoose.Schema.Types.ObjectId,
  first_name: { type: String, required: true },
  last_name: { type: String, required: true },
  preferred_name: { type: String, required: true }
});

module.exports = mongoose.model("Student", studentSchema);
</code></pre>

<p>Here is my controller:</p>

<pre><code>  add_student: (req, res) =&gt; {
    const student = new Student({
      _id: new mongoose.Types.ObjectId(),
      first_name: req.body.first_name,
      last_name: req.body.last_name,
      preferred_name: req.body.preferred_name
    });
    student
      .save()
      .then(result =&gt; {
        console.log(result);
        res.status(201).json({
          message: "Student added!",
          createdStudent: {
            first_name: result.first_name,
            last_name: result.last_name,
            preferred_name: result.preferred_name
          }
        });
      })
      .catch(err =&gt; {
        console.log(err);
        res.status(422).json({
          error: err
        });
      });
  },
</code></pre>

<p>Here is my route:</p>

<pre><code>router.route("/")
  .post(studentController.add_student)
</code></pre>

<p>And here is the data I'm trying to pass through Postman:</p>

<pre><code>{
"first_name": "Steve",
"last_name": "Jones",
"preferred_name": "Stevie Boy"
}
</code></pre>

<p>As you can see, I am passing data, but I keep getting errors as if there's no information there at all.</p>

<p>I guess I need to know how to properly provide pass data through my controller, so my app doesn't think I'm trying to pass an empty object.</p>

